import { post, _delete } from '@/lin/plugin/axios'

class Sql {
  async getSqlCasePage(data) {
    const res = await post('/sql/sql/page', data)
    return res
  }

  async createSqlCase(data) {
    const res = await post('/sql/sql/create', data)
    return res
  }

  async updateSqlCase(data) {
    const res = await post('/sql/sql/update', data)
    return res
  }

  async deleteSql(id) {
    const res = await _delete(`/sql/sql/delete/${id}`)
    return res
  }

  async executeSql(data) {
    const res = await post('/sql/sql/execute', data)
    return res
  }

  async batchExecuteSql(data) {
    const res = await post('/sql/sql/batch', data)
    return res
  }
}

export default new Sql()
